$(document).ready(function(){var t,e=$(".totalTime"),r=[],n=document.getElementById("time-estimate").innerHTML;$.each(e,function(){var t=$(this).attr("start");t=t.split(":");var e=$(this).attr("finish");e=e.split(":");var n=parseInt(e[0])-parseInt(t[0])+(parseInt(t[1])+parseInt(e[1]))/60;r.push(n);var n=n.toFixed(1).replace(".",",");this.innerHTML=n+" h"});var a=r.reduce(function(t,e){return t+e});a=a.toFixed(1).replace(".",","),myObj=document.getElementById("time-passed"),myObj.innerHTML=a+"h",t=Math.round(parseInt(a)/parseInt(n)*100),$(".progression-bar-progress").width(t+"%")});